import React, { useEffect, useState } from "react";
import { MapContainer, TileLayer, Marker, Popup } from "react-leaflet";
import "leaflet/dist/leaflet.css";
import Papa from "papaparse";

const CENTER = { lat: 14.1467, lng: 121.4708 };

export default function Home() {
  const [spots, setSpots] = useState([]);
  const [weather, setWeather] = useState({});
  
  useEffect(() => {
    // Fetch CSV data
    fetch("/data/spots.csv")
      .then((res) => {
        console.log("Response Status:", res.status);  // Log the status of the fetch request
        if (!res.ok) {
          throw new Error("Failed to fetch CSV file");
        }
        return res.text();
      })
      .then((csv) => {
        console.log("CSV Content:", csv);  // Log raw CSV content

        // Parse CSV content
        Papa.parse(csv, {
          header: true,
          skipEmptyLines: true,
          complete: (results) => {
            console.log("Parsed CSV Data:", results.data);  // Log parsed data

            const rows = results.data
              .filter((r) => r.name && r.lat && r.lng) // Make sure spots have name, lat, and lng
              .map((r) => ({
                name: r.name.trim(),
                lat: parseFloat(r.lat),
                lng: parseFloat(r.lng),
                visitors: r.visitors.trim() || "Moderate",
                image: r.image || null,
                description: r.description || "No description",
              }));

            console.log("Filtered Spots:", rows);  // Log filtered spots
            setSpots(rows);  // Set spots data to state
          },
          error: (error) => {
            console.error("CSV Parsing Error:", error); // Log any CSV parsing errors
          }
        });
      })
      .catch((error) => {
        console.error("Error loading CSV:", error); // Log any errors in fetching CSV
      });
  }, []);

  // Check if spots data is available
  useEffect(() => {
    console.log("Spots Loaded:", spots);  // Log the spots when the state is updated
  }, [spots]);

  // Render map and spots
  return (
    <div style={{ display: "grid", gap: 16, gridTemplateColumns: "1fr 1fr" }}>
      <div className="card">
        <h2>Majayjay Overview</h2>
        <div className="map-wrap" style={{ height: "500px" }}>
          {spots.length > 0 ? (
            <MapContainer
              center={CENTER}
              zoom={13}
              style={{ height: "100%", width: "100%" }}
            >
              <TileLayer
                attribution='&copy; <a href="https://www.openstreetmap.org/">OSM contributors</a>'
                url="https://{s}.tile.openstreetmap.org/{z}/{x}/{y}.png"
              />
              {spots.map((s, i) => (
                <Marker key={i} position={[s.lat, s.lng]}>
                  <Popup>
                    <strong>{s.name}</strong>
                    <br />
                    Visitors: {s.visitors}
                    {s.image && (
                      <>
                        <br />
                        <img
                          src={s.image}
                          alt={s.name}
                          style={{ width: "150px", borderRadius: "8px", marginTop: "4px" }}
                        />
                      </>
                    )}
                    <p>{s.description}</p> {/* Description of the spot */}
                  </Popup>
                </Marker>
              ))}
            </MapContainer>
          ) : (
            <div>No spots available to display</div>
          )}
        </div>
      </div>

      <div className="card">
        <h2>Most Visited Places</h2>
        <ul style={{ margin: 0, paddingLeft: 18 }}>
          {spots.length > 0 ? (
            spots.map((s, i) => (
              <li key={i}>
                <strong>{s.name}</strong> â€” {s.visitors} visitors
              </li>
            ))
          ) : (
            <li>No spots found in CSV</li>
          )}
        </ul>
      </div>
    </div>
  );
}
